  getState: () => any;
  dispatch: () => any;
  db: [];

  constructor(obj) {
    const data = localStorage.getItem("todo-list");
    this.getState = obj.getState;
    this.dispatch = obj.dispatch;
    this.db = JSON.parse(data) || [];
  }

  Get() {}

  Put() {}

  Post() {}

  Delete() {}
}
